import './App.css';
import img1 from './img/1.jpeg'
import img2 from './img/2.jpg'
import img3 from './img/3.jpeg'
import img4 from './img/4.jpeg'
import img5 from './img/5.jpeg'


function App() {
  const imgs = [
    {id: 1, imgSrc:img1},
    {id: 2, imgSrc:img2},
    {id: 3, imgSrc:img3},
    {id: 4, imgSrc:img4},
    {id: 5, imgSrc:img5},

  ]
  return (
    <div className='images' >
      <img src={img1} height='100%'></img>
      <img src={img2} height='100%'></img>
      <img src={img3} height='100%'></img>
      <img src={img4} height='100%'></img>
      <img src={img5} height='100%'></img> 



    </div>
  );
}

export default App;
